import React from 'react'
import "./Support.css"

export default function Support(props) {
  //console.log('props', props)
  return (
    <div className="Support">
         <p> {console.log("sel", props.sel)}
        { props.sel?props.sel.attributes.SUPPORTTYPE:'null '}
         </p>
    </div>
  )
}
